          "id": "25797e0a23b5fc75f1c46a11cfdb8c68d9fe86d6",
          "message": "fix: add summary even when failure threshold is surpassed (#285)\n\nAlerts are currently generated by throwing an exception. This means that\nall code that comes after that exception is skipped, including generating\nthe Action summary.\n\nWe can easily fix this, by generating the summary first.\n\nLonger term, we might want to reconsider the code style here.\nAn exception should model something exceptional happening in our code.\nSeeing bad benchmark numbers is not exceptional. It's what this tool is\nsupposed to handle.\n\nCloses https://github.com/benchmark-action/github-action-benchmark/issues/254",
          "timestamp": "2025-03-12T08:27:35+01:00",
          "tree_id": "873434235992dcf36b234db1b50d3fdb0fc4eca0",
          "url": "https://github.com/benchmark-action/github-action-benchmark/commit/25797e0a23b5fc75f1c46a11cfdb8c68d9fe86d6"
